      function isotopeCatSelection() {
        $('.portfolio-items:not(".carousel")').each(function () {
          var isotopeCatArr = [];
          var $portfolioCatCount = 0;
          $(this)
            .parent()
            .parent()
            .find("div[class^=portfolio-filters] ul li")
            .each(function (i) {
              if ($(this).find("a").length > 0) {
                isotopeCatArr[$portfolioCatCount] = $(this)
                  .find("a")
                  .attr("data-filter")
                  .substring(1);
                $portfolioCatCount++;
              }
            });
          isotopeCatArr.shift();
          var itemCats = "";
          $(this)
            .find("> div")
            .each(function (i) {
              itemCats += $(this).attr("data-project-cat");
            });
          itemCats = itemCats.split(" ");
          itemCats.pop();
          itemCats = $.unique(itemCats);
          if (
            $(this).attr("data-categories-to-show").length != 0 &&
            $(this).attr("data-categories-to-show") != "all"
          ) {
            $userSelectedCats = $(this)
              .attr("data-categories-to-show")
              .replace(/,/g, " ");
            $userSelectedCats = $userSelectedCats.split(" ");
            if (!$(this).hasClass("infinite_scroll"))
              $(this).removeAttr("data-categories-to-show");
          } else {
            $userSelectedCats = itemCats;
          }
          var notFoundCats = [];
          $.grep(isotopeCatArr, function (el) {
            if ($.inArray(el, itemCats) == -1) notFoundCats.push(el);
            if ($.inArray(el, $userSelectedCats) == -1) notFoundCats.push(el);
          });
          if (notFoundCats.length != 0) {
            $(this)
              .parent()
              .parent()
              .find("div[class^=portfolio-filters] ul li")
              .each(function () {
                if ($(this).find("a").length > 0) {
                  if (
                    $.inArray(
                      $(this).find("a").attr("data-filter").substring(1),
                      notFoundCats
                    ) != -1
                  ) {
                    $(this).hide();
                  } else {
                    $(this).show();
                  }
                }
              });
          }
        });
      }
